import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

const HomePage: React.FC = () => <h1>Home Page</h1>;
const AboutUs: React.FC = () => <h1>About Us</h1>;
const IntakeForms: React.FC = () => <h1>Intake Forms</h1>;
const CommunityOutreachAndEducationIntakeForm: React.FC = () => (
  <h1>Community Outreach Form</h1>
);
const ThriveInternationalIntakeForm: React.FC = () => (
  <h1>Thrive International Form</h1>
);

const App: React.FC = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/about" element={<AboutUs />} />
        <Route path="/intake" element={<IntakeForms />} />
        <Route
          path="/intake/community-outreach"
          element={<CommunityOutreachAndEducationIntakeForm />}
        />
        <Route
          path="/intake/thrive-international"
          element={<ThriveInternationalIntakeForm />}
        />
      </Routes>
    </Router>
  );
};

export default App;
